import React from 'react';
import { NavLink } from 'react-router-dom';
import { connect } from 'react-redux';

import LinkItem from '../components/LinkItem/LinkItem'

import styles from './DefaultPage.module.css'


function render({departments}) {
	console.log('cloud with departments', departments)
	return (
		<div className={styles.page}>
			<ul className={styles.list}>
				{departments.map(department => 
					<NavLink key={department.code} to={`department/${department.code}/doctor`} >
						<LinkItem
							key={department.code}
							index={department.code}
							text={department.name} />
					</NavLink>)}
			</ul>
		</div>
	);
}


const mapStateToProps = state => ({departments: state.emias.departments});

export default connect(mapStateToProps)(render);
